import React from "react";
import "./Join.css";
function Join() {
  return (
    <div className="Join" id="join">
      <div className="join-left">
        <div>
          <span className="stroke-text">READY TO </span>
          <span>LEVEL UP </span>
        </div>
        <div>
          <span>YOUR BODY </span>
          <span className="stroke-text">WITH US? </span>
        </div>
      </div>
      <div className="join-right"></div>
    </div>
  );
}

export default Join;
